                    The students are exposed to real time construction activities. The students are taken for regular
                    Industrial Visits to various construction sites, water treatment plants, Chennai port

                    trust and Research Laboratories like Structural Engineering Research Centre (SERC), IIT Madras Labs,
                    Highway Research Station and Hydrological Research Station to update themselves with

                    the research activities taking place in this field. <br><br>
